datosEmpleoCargoComision.funcionPrincipal:
I. COLABORAR EN EL DISEÑO Y LA IMPLEMENTACIÓN DE LOS PROCESOS DE PLANEACIÓN, PROGRAMACIÓN,
PRESUPUESTACIÓN Y DE EVALUACIÓN DEL TRIBUNAL;
II. EN COORDINACIÓN CON LA DIRECCIÓN DE ADMINISTRACIÓN, PROPONER A LA JUNTA PARA SU
AUTORIZACIÓN EL ANTEPROYECTO DE PRESUPUESTO DE EGRESOS DEL TRIBUNAL, CON BASE EN LOS
PROGRAMAS ESTABLECIDOS POR LAS UNIDADES ADMINISTRATIVAS EN CONGRUENCIA CON EL PLAN RECTOR DE
GESTIÓN DEL TRIBUNAL;
III. DISEÑAR Y ESTABLECER SISTEMAS DE INFORMACIÓN CON FINES ESTADÍSTICOS PARA LLEVAR EL
CONTROL RESPECTO A LA EVOLUCIÓN DE LAS ACTIVIDADES DEL TRIBUNAL;
IV. SOLICITAR INFORMACIÓN A LAS DIRECCIONES, UNIDADES ADMINISTRATIVAS Y ÓRGANOS JURISDICCIONALES
DEL TRIBUNAL, SOBRE LA EJECUCIÓN DE PROGRAMAS, PLANES Y PROYECTOS INSTITUCIONALES;
V. SISTEMATIZAR Y DAR SEGUIMIENTO A LA INFORMACIÓN QUE EMITAN LAS DIRECCIONES Y UNIDADES
ADMINISTRATIVAS DEL TRIBUNAL SOBRE EL CUMPLIMIENTO DE OBJETIVOS, METAS Y AVANCES;
VI. COADYUVAR EN LA ELABORACIÓN DEL INFORME ANUAL DE ACTIVIDADES DE LA PRESIDENCIA, ASÍ COMO
EN EL PROYECTO DE PLAN RECTOR DE GESTIÓN DEL TRIBUNAL;
VII. COORDINAR CON LAS DIRECCIONES Y UNIDADES ADMINISTRATIVAS DEL TRIBUNAL LA ELABORACIÓN DEL
PLAN ANUAL DE TRABAJO;
VIII.PROPONER Y EJECUTAR EN SU CASO, LINEAMIENTOS, REGLAS Y CRITERIOS EN MATERIA DE INFORMACIÓN Y
ACTUALIZACIÓN DE LA PÁGINA WEB DEL TRIBUNAL;
IX. PROPONER Y EJECUTAR, EN SU CASO, LINEAMIENTOS, REGLAS, CRITERIOS Y METODOLOGÍA EN MATERIA DE
INFORMACIÓN, PLANEACIÓN, PROGRAMACIÓN Y EVALUACIÓN;
X. LLEVAR A CABO UN SISTEMA DE EVALUACIÓN DE RESULTADOS DE LA GESTIÓN;
XI. REALIZAR LAS FUNCIONES RELATIVAS A LAS OBLIGACIONES EN MATERIA DE TRANSPARENCIA,
INFORMACIÓN PÚBLICA Y PROTECCIÓN DE DATOS PERSONALES.
